说明。书中涵盖了基本的T-SQL数据操作、存储过程、触发器和LJDF的使用。以及针对数据库安全和维护的高级T-SQL技术等多方面的内容。新版更是贯穿着SQL Server 2008的新特性。具体涉及命令、选项、数据类型、函数以及功能等内容。此外。你无需按照顺序阅读和学习.可以根据自身需要迅速找到相应的信息。高效地完成工作。</p><p>截图：</p><p><img src=\"/image/2018/09/11/20180911100438.jpg\" alt=\"1602222W0C.jpg\"><br></p><div class=\"para-title level-2\" label-module=\"para-title\"><h2 class=\"title-text\">图书目录</h2></div><div class=\"para\" label-module=\"para\">第1章SELECT</div><div class=\"para\" label-module=\"para\">第2章执行、捕获和跟踪数据修改55</div><div class=\"para\" label-module=\"para\">第3章事务、锁定、阻塞和死锁100</div><div class=\"para\" label-module=\"para\">第4章表123</div><div class=\"para\" label-module=\"para\">第5章索引167</div><div class=\"para\" label-module=\"para\">第6章全文搜索183</div><div class=\"para\" label-module=\"para\">第7章视图201</div><div class=\"para\" label-module=\"para\">第8章SQL Server函数216</div><div class=\"para\" label-module=\"para\">第9章条件处理、流控制和游标258</div><div class=\"para\" label-module=\"para\">第10章存储过程273</div><div class=\"para\" label-module=\"para\">第11章用户定义函数和类型289</div><div class=\"para\" label-module=\"para\">第12章触发器315</div><div class=\"para\" label-module=\"para\">12.1DML触发器316</div><div class=\"para\" label-module=\"para\">第13章CLR集成339</div><div class=\"para\" label-module=\"para\">第14章XML、分层和空间数据354</div><div class=\"para\" label-module=\"para\">第15章提示380</div><div class=\"para\" label-module=\"para\">第16章错误处理388</div><div class=\"para\" label-module=\"para\">第17章主体401</div><div class=\"para\" label-module=\"para\">第18章安全对象、权限和审核423</div><div class=\"para\" label-module=\"para\">第19章加密462</div><div class=\"para\" label-module=\"para\">第20章Service Broker489</div><div class=\"para\" label-module=\"para\">第21章配置和查看SQL Server的选项520</div><div class=\"para\" label-module=\"para\">第22章创建和配置数据库524</div><div class=\"para\" label-module=\"para\">第23章数据库完整性和优化565</div><div class=\"para\" label-module=\"para\">……</div>'),(110,'test','test2','SQL必知必会 第三版 .pdf',1,21,58,'\0','2018-09-11 22:08:57',NULL,NULL,NULL,2,'xzph','z8yj','<p><