\">载入其中</span><span class=\"bjh-p\">，效果是不是很棒~（写手机适配的样式我可写了很久~）</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\"><span><a data-magnify=\"gallery\" data-caption=\"勿扰-图库\" href=\"http://wurao.xin/static/userImages/20180607/1528366547465089980.png\"><img src=\"http://wurao.xin/static/userImages/20180607/1528366547465089980.png\" title=\"1528366547465089980.png\" alt=\"image.png\"></a></span></span></p><p style=\"text-align: justify;\"><br></p><p style=\"text-align: justify;\">它提供的高可用的侧边栏，可以对一些资源进行筛选，在里面实现异步加载，拥有良好体验。<span>当然，app的进阶功能就是可以对你插入的网页进行相关控制，可以阻止网页弹出的广告、显示的页面、标题等，如下，当然一两句话说不清楚，里面有很多很强大的功能，搭配起来你会发现不一样的“美<span>”~</span></span></p><p style=\"text-align: justify;\"><a data-magnify=\"gallery\" data-caption=\"勿扰-图库\" href=\"http://wurao.xin/static/userImages/20180607/1528366615687091566.png\"><img src=\"http://wurao.xin/static/userImages/20180607/1528366615687091566.png\" title=\"1528366615687091566.png\" alt=\"image.png\"></a></p><p style=\"text-align: justify;\"><span><span><br></span></span></p><p style=\"text-align: justify;\">这是app后台编辑页面，可以对页面的一些布局，样式进行优化调整。<span>当你完成设计后，右上角点击打包安装即可安装。<span>大家也可以看帮助文档和<span>作品演示</span>，进行相关学习或者修改，即可学会基本的操作。</span></span></p><p style=\"text-align: justify;\"><a data-magnify=\"gallery\" data-caption=\"勿扰-图库\" href=\"http://www.wurao.xin/static/userImages/20180607/1528366563084057893.png\"><img src=\"http://www.wurao.xin/static/userImages/20180607/1528366563084057893.png\" title=\"1528366563084057893.png\" alt=\"image.png\"></a></p><p style=\"text-align: justify;\"><br></p><p style=\"text-align: justify;\">高级教学演示：</p><p style=\"text-align: justify;\"><a href=\"https://www.bilibili.com/video/av21276227?share_medium=android&amp;share_source=copy_link&amp;bbid=8E9421B2-19DF-4A7F-9D1C-FF7D9557C7BD44884infoc&amp;ts=1522107475891\" target=\"_blank\">你看不看^ ^</a></p>'),(122,'test','test2','clementine挖掘工具',1,29,93,'\0','2018-09-12 03:05:38',NULL,NULL,NULL,2,'lp3n','phl0','<p><strong>SPSS Clementine 12</strong><span>是一款功能强大的