g\"><quote>完美的多终端适配</quote></h2><p>Grace主题满足多终端浏览，足够逼格的响应式可触摸滑动的幻灯片等优点，无论您使用电脑、平板还是智能手机，Grace主题都能为您呈现完美的界面及极好的体验。另外注意的是，为了更好的支持多终端浏览，Grace主题使用了WordPress官方响应式函数来判断每个终端设备，因此，如果使用cdn加速等，可能会照成PC、手机端浏览错乱。建议关闭这类CDN加速的优化。</p><h2 class=\"yinyong\"><quote>支持优酷/土豆等视频网站视频源播放（16年11月新增）</quote></h2><p>完美支持优酷/土豆等视频网站视频源播放，平板、手机无缝自动自适应屏幕大小。添加教程：<a href=\"https://www.suxing.me/wp-courses/1196.html\">《WordPress如何插入视频网站的视频源》</a></p><h2 class=\"yinyong\"><quote>网站配色自由搭配</quote></h2><p>主题支持修改主题配色功能，自由搭配网站颜色，轻松打造属于自己style的网站。 导航栏支持滚动悬停，增加用户站内浏览时间，提高网站用户体验！</p><h2 class=\"yinyong\"><quote>网站速度优化</quote></h2><p>主题支持缩略图支持真延迟加载，图片无需缓存到第三方CDN，网站浏览速度一样飞快飞快！！</p><h2 class=\"yinyong\"><quote>丰富的页面模版</quote></h2><p>主题内置丰富，大气页面模版，网站地图页面、友情链接页面、类hao123式网站导航页面、点赞排行榜页面、网站标签页面。</p><h2 class=\"yinyong\"><quote>易用的后台操作</quote></h2><p>Grace 内置强大的后台自定义设置中心，满足您在后台自定义功能，调整布局，管理小工具，优化搜索引擎，优化用户浏览体验的更多可能。 启动Grace ，3、5分钟即可完成操作，打造属于您的极客空间。</p><h2 class=\"yinyong\"><quote>自定义边栏小工具</quote></h2><p>主题自带多种小工具，协助您实现不同的功能，大大丰富网站内容及提供用户体验。 小工具支持滚动悬停，用户浏览信息量暴涨，更利于广告及重要信息的展示</p><h2 class=\"yinyong\"><quote>良好浏览器兼容</quote></h2><p>主题能够良好的兼容各大主流浏览器。为了更好的体验，ie11以下的版本或者360之流，我们已经拒之门外。</p><h2 class=\"yinyong\"><quote>多样的短代码</quote></h2><p>主题提供多种短代码样式，让您的文章排版更多样，告别千篇一律、单调。 更多的主题特色及体验，还需您细致品味。</p><h2 class=\"yinyong\"><quote>小白不菜，主题轻松用</quote></h2><p>Grace主题有详细的使用教程，Grace主题用户交流Q群内上百位基友和你一起分享使用Grace主题的乐趣和心得。 小白到老手，分分钟的事儿！ PS：Grace主题的使用教程在Q群共享中。</p><p><strong>PS：主题不议价，如想议价还请免开尊口，谢谢，不要浪费双方时间。另外购买的仅仅是主题而已，艺术家绕道。</strong></p><h2 class=\"yinyong\"><quote>主题预览</quote></h2><p><a href=\"https://www.suxing.me/wp-content/uploads/2015/07/2017090515555790.jpg\" alt=\"Grace主题\" title=\"Grace主题\" rel=\"box\" class=\"fancybox\"><img alt=\"Grace主题-苏醒主题\" class=\"alignnone size-full wp-image-1375\" src=\"https://www.suxing.me/wp-content/uploads/2015/07/2017090515555790.jpg\" width=\"1200\" height=\"700\" srcset=\"https://www.suxing.me/wp-content/uploads/2015/07/2017090515555790.jpg 1200w, https://www.suxing.me/wp-content/uploads/2015/07/2017090515555790-768x448.jpg 768w\" sizes=\"(max-width: 1200px) 100vw, 1200px\"></a><br><a href=\"https://www.suxing.me/wp-content/uploads/2015/07/2017090515594772.png\" alt=\"Grace主题\" title=\"Grace主题\" rel=\"box\" class=\"fancybox\"><img alt=\"Grace主题-苏醒主题\" class=\"alignnone size-full wp-image-1379\" src=\"https://www.suxing.me/wp-content/uploads/2015/07/2017090515594772.png\" width=\"1200\" height=\"700\" srcset=\"https://www.suxing.me/wp-content/uploads/2015/07/2017090515594772.png 1200w, https://www.suxing.me/wp-content/uploads/2015/07/2017090515594772-768x448.png 768w\" sizes=\"(max-width: 1200px) 100vw, 1200px\"></a></p><h1>购买须知</h1><div class=\"theme-faq\"><h3><strong>1.</strong>&nbsp;安装主题需要对服务器有什么要求?</h3><p>全新升级，主机请选择linux主机，php版本为5-7。win机，请确保你之前使用过WP主题，并正常可以使用。</p><h3><strong>2.</strong>&nbsp;是一次性收费还是每年收费？我能免费升级吗?</h3><p>主题是一次性收费，下载的主题可以永久使用。我们提供自您购买日起1年的免费更新维护服务，期间（周期1-2个月不等）会不间断更新主题代码，修复Bug，适时扩展主题功能；1年到期后，仅需支付少量的维护年费（按您购买主题当时售价的6.6折的收取）即可获得未来一年主题的更新包,确保您的网站始终运行在最佳状态,如在使用上你有任何建议或者发现BUG，请和我们联系，我们将把适合大众需求的建议，更新到主题上面，令主题更丰满，更赞！如不续费，也可继续使用，但不在提供最新的主题更新包下载，仅可提供到期日之前的主题包下载。</p><h3><strong>3.</strong>&nbsp;购买主题后，包安装调试吗？</h3><p>您购买主题后，需要您自己根据下面的安装步骤进行安装和调试。如安装调试过程，有任何疑问，可以咨询我们。一般通过半小时左右的调试即可调试成类似演示站的。</p><p>如果你实在懒得弄，可以私聊我们，我们也提供付费调试服务，200-500元/次，帮你安装主题调试至演示站的全部效果出来，但不包括发布文章等。</p><h3><strong>4.</strong>&nbsp;我能退货吗?</h3><p>购买订单一旦生成，支付完毕后，一律不接受任何形式的退款或者换货。</p><h3><strong>5.</strong>&nbsp;我能换货吗?</h3><p>主题源码属于虚拟商品，具有可复制性，可传播性，版权原因，一旦授予，不接受任何形式的退款、换货要求。大家在使用wordpress主题的时候请尊重主题作者的劳动成果和版权标识！</p><h3><strong>6.</strong>&nbsp;主题可以本地调试吗?</h3><p>主题需要授权域名使用，理论上不支持本地调试。你可以尝试把调试地址调整为已授权地址进行调试，但不保证可以正常使用。最佳的调试方式为：直接把主题上传到你的主机空间进行调试。</p><h3><strong>7.</strong>&nbsp;主题可以进行二次开发、修改吗?</h3><p>主题中Function文件经过特殊加密，如你要添加代码到此文件，请把代码加至同目录中文件名为function_suxing的文件中。除此以外，其他文件代码均可以正常修改。注意：如因个人删改代码造成网站出现不稳定、Bug等其他情况，苏醒一概不负责。</p><h3><strong>8.</strong>&nbsp;我用了一段时间后，能更换域名吗？</h3><p>主题是绑定域名的，一旦购买后可免费修改2次顶级域名，超过2次后，每次收费15元，请QQ联系苏醒。子域名的使用是不受限制的，例如主域名是suxing.me，那abc.suxing.me也是可以使用主题。</p><p>如果您购买本主题，则表明您已经阅读并认可以上说明内容。</p><div id=\"theme-5\" class=\"info-i info-5 box-shadow\"><h1>授权说明(必读)：</h1><div class=\"theme-faq\"><p>如果你对本主题感兴趣，想购买，可在本站注册后自行购买，授权域名后，可自行在「会员中心」中的「我的订单」中下载到本主题。</p><p>1、填写的授权域名必须为顶级域名，不能是二级域名，无需添加http:// 和www。服务器的IP不能授权，如你的网站在备案，可填写服务商提供的临时访问域名，但不保证完全可以正常使用。</p><p>2、子域名不受限制的，例如顶级域名是suxing.me，那abc.suxing.me也是可以使用主题。</p><p>3、在使用主题过程中，可免费修改2次顶级域名，超过2次，每次收费15元，请QQ联系苏醒。</p><p>4、如需增加多一个顶级域名（3个内），按主题售价的半价另外收费，请QQ联系苏醒。</p><p>如果您购买本主题，则表明您已经阅读并认可以上说明内容。</p></div></div><div id=\"theme-6\" class=\"info-i info-6 box-shadow\"><h1>售后服务</h1><div class=\"theme-service\"><p>苏醒主题提供自您购买日起1年的免费更新维护服务，期间会不断更新Bug、新增功能和售后支持；1年到期后，仅需支付少量的维护年费（按您购买主题当时售价的6.6折的收取）即可获得未来一年主题的更新包。如不续费，也可继续使用，但不在提供最新的主题更新包下载，仅可提供到期日之前的主题包下载。</p><table class=\"layui-table\"><tbody><tr><td class=\"td\" width=\"150\" rowspan=\"7\"><strong>售后服务范围</strong></td><td>1、主题使用问题、主题Bug反馈和功能建议</td></tr><tr><td>2、服务器及配置推荐</td></tr><tr><td>3、主题安装调试（需额外付费，一般 ¥200-400）</td></tr><tr><td>4、服务器环境支持（需额外付费，一般 ¥200-500）</td></tr><tr><td>5、服务器和数据迁移（需额外付费，一般 ¥600-1500）</td></tr><tr><td>6、主机搬家等自身问题导致主题不可用 (代调试费用 ¥100-500，仅限云服务器)</td></tr><tr><td>7、付费定制功能，需协商（修改/新增主题功能或演示，最低150元/个）</td></tr><tr><td class=\"td\"><strong>售后服务时间</strong></td><td><strong>周一至周五（法定节假日除外） 10:00-18:00</strong></td></tr><tr><td class=\"td\"><strong>售后联系方式</strong></td><td>Q&nbsp;Q：25679903（已购买用户，请带上你的购买订单号，（盗版者勿扰），售前请在10:00-20:00之间咨询，其他时间可能在忙。）注意：QQ上使用震屏等骚扰行为直接拉黑。Grace主题有使用难题请到群里提问，私聊不回。</td></tr></tbody></table></div></div><div id=\"theme-7\" class=\"info-i info-7 box-shadow\"><h1>更新日志</h1><div class=\"theme-faq\"><p>2018-02-19 |&nbsp;<a href=\"https://www.suxing.me/update/grace-updata-text/1503.html\" target=\"_blank\">Grace主题v8.2版本更新，修复多个问题</a></p><p>2017-09-04 |&nbsp;<a href=\"https://www.suxing.me/update/1369.html\" target=\"_blank\">Grace主题更新至8.0，新增专题等多个功能</a></p><p>2017-06-10 |&nbsp;<a href=\"https://www.suxing.me/update/1321.html\" target=\"_blank\">Grace主题7.0.000001小版本更新</a></p><p>2017-05-17 |&nbsp;<a href=\"https://www.suxing.me/update/1303.html\" target=\"_blank\">Grace主题更新至7.0版本</a></p><p>2017-03-09 |&nbsp;<a href=\"https://www.suxing.me/update/1271.html\" target=\"_blank\">Grace主题更新至6.2版本，优化和修复几个BUG</a></p><p><a href=\"http://www.suxing.me/update\" target=\"_blank\">更多...</a></p></div></div><div id=\"theme-8\" class=\"info-i info-8 box-shadow\"><h1>常见问题</h1><div class=\"theme-faq\"><h3><strong>1.</strong>&nbsp;主题如何上传至网站？上传主题后，网站空白？</h3><p>第一步：先把网站在用的所有插件都关闭了；</p><p>第二步：上传主题，云主机或者其他VPN服务器请使用winscp软件上传主题，虚拟机用户使用filezilla软件上传主题，传输模式为二进制。把主题解压到一个新建文件夹中（文件名须为英文），然后上传至/wp-content/themes文件夹里。</p><p>第三步：新建好各种的分类、文章、页面；</p><p>第四步：在配置【主题选项】中的各种功能的开启关闭。</p><p>第五步：才重新开启你的插件。最好逐一打开。如开启了插件，网站有各种的灵异事件，代码冲突等，请逐一开关插件，找到和主题不兼容的插件，然后删除或者找其他插件代替。</p><h3><strong>2.</strong>&nbsp;为什么显示授权失败？</h3><p>有些朋友可能在主机还没备案的时候，使用了主机提供的IP或者临时域名先搭建好了网站。</p><p>于是乎，在[后台]-[设置]-[常规]中的WordPress地址（URL）和站点地址（URL）填写的并不是在苏醒主题绑定的域名，所以就会出现主题授权失败的提示。只要登录后台，重新把绑定的域名填在的WordPress地址（URL）和站点地址（URL）上即可。见下图</p><p><img src=\"http://www.suxing.me/wp-content/uploads/2016/02/2016020311104932.png\" alt=\"为什么显示授权失败\"></p><h3><strong>3.</strong>&nbsp;如果上传主题后，选用主题后，首页显示空白，怎么办？</h3><p>请使用FTP上传工具进行上传（推荐使用filezilla），并把传输模式调整为：二进制模式。</p><p><img class=\"alignnone size-full wp-image-581\" src=\"http://www.suxing.me/wp-content/uploads/2014/11/20141116123809.jpg\"></p></div></div></div></div>'),(183,'test','test2','Java大数据视频教程 无加密 下载',7,34,146,'','2018-09-13 13:34:15',NULL,NULL,NULL,2,'y69m','r4c6','<p>Java大数据视频教程 无加密 下载</p><p><br></p><p><img src=\"/image/2018/09/13/20180913013349.jpg\" alt=\"Java大数据视频教程 无加密 下载 图1.jpg\"><br></p><p><br></p><p><img src=\"/image/2018/09/13/20180913013356.jpg\" alt=\"Java大数据视频教程 无加密 下载 图2.jpg\"><br></p>'),(184,'test','test2','java1234_JavaScript高级篇视频教程 下载',1,22,92,'','2018-09-13 14:58:34',NULL,NULL,NULL,2,'wjp1','1xro','<p>java1234_JavaScript高级篇视频教程 下载</p><p><br></p><div class=\"tree-node\"><span class=\"tree-hit tree-expanded\"></span><span class=\"tree-icon tree-folder tree-folder-open\"></span><span class=\"tree-title\">一头扎进JavaScript(